import{_ as e,o as t,c as a,k as _,a as o}from"./chunks/framework.cc795e4d.js";const E=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"docs/治疗进展/胰岛素专题/在胰岛素初治的2型糖尿病-T2D-患者中-每周一次基础胰岛素BIF的血糖控制与每日一次德谷胰岛素-DEG-相似.md","filePath":"docs/治疗进展/胰岛素专题/在胰岛素初治的2型糖尿病-T2D-患者中-每周一次基础胰岛素BIF的血糖控制与每日一次德谷胰岛素-DEG-相似.md"}'),s={name:"docs/治疗进展/胰岛素专题/在胰岛素初治的2型糖尿病-T2D-患者中-每周一次基础胰岛素BIF的血糖控制与每日一次德谷胰岛素-DEG-相似.md"},c=_("h3",{id:"在胰岛素初治的2型糖尿病-t2d-患者中-每周一次基础胰岛素bif的血糖控制与每日一次德谷胰岛素-deg-相似",tabindex:"-1"},[o("在胰岛素初治的2型糖尿病(T2D)患者中，每周一次基础胰岛素BIF的血糖控制与每日一次德谷胰岛素(DEG)相似 "),_("a",{class:"header-anchor",href:"#在胰岛素初治的2型糖尿病-t2d-患者中-每周一次基础胰岛素bif的血糖控制与每日一次德谷胰岛素-deg-相似","aria-label":'Permalink to "在胰岛素初治的2型糖尿病(T2D)患者中，每周一次基础胰岛素BIF的血糖控制与每日一次德谷胰岛素(DEG)相似"'},"​")],-1),n=_("p",null,"Velocity临床研究所 Juan Pablo Frias MD",-1),i=_("p",null,"基础胰岛素BIF(LY3209590)是一种结合了新型胰岛素变体和人IgG Fc结构域的融合蛋白，设计用于每周一次（QW）给药。这项随机、平行、开放标签II期研究评估了BIF与DEG在既往接受过口服降糖药治疗的胰岛素初治T2D患者中的安全性和疗效。随机分配至BIF(N = 129)和DEG(N = 135)组的患者基线HbA1c为8.0%。26周后，在HbA1c方面，BIF显示出相对于DEG的非劣效性，且在第26周时，两组平均有 > 75%的时间葡萄糖目标范围内(3.889-10 mmol/L)（图1）。2级低血糖的发生率均较低，无显著差异（BIF = 0.22；DEG = 0.15起事件/患者/年；p = 0.64）。 BIF和DEG之间治疗后出现的不良事件的发生率相似。QW BIF达到了与DEG相似的优秀血糖控制，无令人担忧的低血糖或其他新发现的安全性问题，支持其在III期研究中继续开发。",-1),d=_("p",null,[_("img",{src:"https://p.ipic.vip/76jfx2.png",alt:"image-20231005151934090"})],-1),r=[c,n,i,d];function l(D,p,I,B,F,h){return t(),a("div",null,r)}const G=e(s,[["render",l]]);export{E as __pageData,G as default};
